import React from 'react';
import { useNavigate } from 'react-router-dom';
import Button from '../components/Button';

const HomePage = () => {
  const navigate = useNavigate();
  const containerStyle = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    height: '100vh',
    backgroundColor: '#343a40',
    color: '#fff',
    textAlign: 'center',
    flexDirection: 'column',
  };

  return (
    <div style={containerStyle}>
      <h1>Welcome to the Travel Agency System</h1>
      <p>Manage vehicles, employees, trips, and bookings efficiently.</p>
      <Button text="Go to Employee Dashboard" onClick={() => navigate('/employee')} />
      <Button text="Go to Booking Dashboard" onClick={() => navigate('/booking')} />
    </div>
  );
};

export default HomePage;
